import React,{Component} from 'react'
import './sidenavi.scss'
let naviInfo = [
    {
        id: '1',
        "code": "home",
        "name": "首页",
        "orderSeq": 1,
        "target": "/home",
        "status": 1,
        "selected": null,
        "children": null
    }, {
        id: '2',
        "code": "delivery",
        "name": "投放",
        "orderSeq": 4,
        "target": "/delivery",
        "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
        "status": 1,
        "selected": null,
        "children": [{
            id: '3',
            "code": "RMScope",
            "name": "素材管理",
            "orderSeq": 1,
            "target": "/manage",
            "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
            "status": 1,
            "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
            "selected": null,
            "children": null
        }, {
            id: '4',
            "code": "UMScope",
            "name": "任务投放",
            "orderSeq": 2,
            "target": "/task",
            "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
            "status": 1,
            "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
            "selected": null,
            "children": null
        }]
    },
    {
        id: '6',
        "code": "finance",
        "name": "财务",
        "orderSeq": 4,
        "target": "/finance",
        "status": 1,
        "selected": null,
        "children": [
            {
                id: '11',
                "code": "finance",
                "name": "资金流水",
                "orderSeq": 1,
                "target": "/capital",
                "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
                "status": 1,
                "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
                "selected": null,
                "children": null
            },
            {
                id: '12',
                "code": "finance",
                "name": "开票信息",
                "orderSeq": 2,
                "target": "/receipt",
                "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
                "status": 1,
                "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
                "selected": null,
                "children": null
            }
        ]
    }, {
        id: '7',
        "code": "account",
        "name": "账户",
        "orderSeq": 4,
        "target": "/account",
        "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
        "status": 1,
        "selected": null,
        "children": [{
            id: '8',
            "code": "RMScope",
            "name": "账户信息",
            "orderSeq": 1,
            "target": "/info",
            "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
            "status": 1,
            "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
            "selected": null,
            "children": null
        }, {
            id: '9',
            "code": "UMScope",
            "name": "密码修改",
            "orderSeq": 2,
            "target": "/password",
            "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
            "status": 1,
            "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
            "selected": null,
            "children": null
        },
            {
                id: '10',
                "code": "UMScope",
                "name": "资质管理",
                "orderSeq": 2,
                "target": "/condition",
                "handleRight": "HR_CUSTOMIZED_ROBOT;HR_TRIAL_GROUP",
                "status": 1,
                "parentId": "2617d635-2520-4cab-afef-74fd6d3754c8",
                "selected": null,
                "children": null
            }
        ]
    }
]

const dataMap = {
    home: 'icon-home',
    delivery: 'icon-delivery',
    dashboard: 'icon-data',
    finance: 'icon-wealth',
    account: 'icon-account'
}
// const SubNavi = ({ navi, subNavi, expand, history }) => {
//     return (
//         <div className={''} style={{ height: expand ? subNavi.length * 36 + 'px' : 0 }}>
//             {
//                 subNavi.map((v, i) => <div key={i} onClick={() => { history.push(navi.target + v.target) }}>{v.name}</div>)
//             }
//         </div>
//     )
// }
class NaviItem extends Component {
    constructor(props) {
        super(props)
    }
    clickHandle = () => {
        // const { navi, expandHandle, history } = this.props
        // if (navi.children == null) {
        //     history.push(navi.target)
        // }
        // expandHandle(navi.id)
    }
    render() {
        const { navi, history } = this.props
        const activeFlag = history.location.pathname.includes(navi.target)
        return (
            <div className={''}>
                {/*<div className={`${styles["naviText"]} ${activeFlag ? styles["active"] : ''} ${navi.selected ? styles["expand"] : ''}`} onClick={this.clickHandle}>*/}
                    {/*<div className={`${styles["navi-icon"]} ${styles[dataMap[navi.code]]}`}></div>{navi.name}*/}
                {/*</div>*/}
                {/*{navi.children ? <SubNavi navi={navi} subNavi={navi.children} expand={navi.selected} history={history} /> : ''}*/}
            </div>
        )
    }
}

export default class SideNavi extends Component{
    constructor(props){
        super(props)
        this.state = {
            naviInfo: naviInfo
        }
    }
    expandHandle=()=>{

    }
    render(){
        const {history} =this.props
        return <div className='naviBox'>
            <div className="avatar">
                <img src="http://img.zcool.cn/community/01ee0d5544f1380000019ae9895b3f.jpg@1280w_1l_2o_100sh.jpg" alt="" />
                <p>群宠管理系统</p>
            </div>
            <div className="navi">
                {
                    naviInfo.map((navi, i) => {
                        return <NaviItem key={i} navi={navi} expandHandle={this.expandHandle} history={history} />
                    })
                }
            </div>
        </div>
    }
}
